sys_variable_value.value:
(function parse(inputs, outputs) {
    var xmlDoc = new XMLDocument2();
     xmlDoc.parseXML(inputs.sourceItem);
     outputs.targetObject.TargetGroupArn= xmlDoc.getNodeText('/member/TargetGroupArn');
     outputs.targetObject.HealthCheckEnabled= xmlDoc.getNodeText('/member/HealthCheckEnabled');
     outputs.targetObject.Protocol= xmlDoc.getNodeText('/member/Protocol');
     outputs.targetObject.Port= xmlDoc.getNodeText('/member/Port');
     outputs.targetObject.TargetGroupName= xmlDoc.getNodeText('/member/TargetGroupName');
     outputs.targetObject.VpcId= xmlDoc.getNodeText('/member/VpcId');
     outputs.targetObject.HealthCheckIntervalSeconds= xmlDoc.getNodeText('/member/HealthCheckIntervalSeconds');
    outputs.targetObject.HealthCheckTimeoutSeconds= xmlDoc.getNodeText('/member/HealthCheckTimeoutSeconds');
})(inputs, outputs)

(function execute(inputs, outputs) {
  var region = inputs.region.trim();
  var session = gs.getSession();
  session.putClientData('SN_AWS_LOAD_BALANCING_REGION', region || "us-east-1");
  session.putClientData("SN_AWS_LOAD_BALANCING_FILTER", null);
  outputs.region = region;
  outputs.target_group_arn = inputs.target_group_arn.trim();
})(inputs, outputs);

